import React from 'react';
import '../components/Poganec/jury_meet.css'
import {Link} from "react-router-dom";




const JuryMeet = () => {
    return (
        <div className="JuryMeet">
            <Link className="jury_nav_button first_button">Текущие мероприятия</Link>
            <button className="jury_nav_button scnd_button">История</button>
            <button className="jury_nav_button third_button">Профиль</button>

        </div>

    );
};

export default JuryMeet;
